Fes una funció amb python que encripti les contrasenyes que se li passin per paràmetre a partir d'una altra contrasenya que l'usuari haurà de conèixer per a poder desencriptar les contrasenyes novament. A més, en la funció de signatura de les contrasenyes, també es pot generar un hash dels tokens que l'usuari es faci per a poder fer un check per veure si aquestes són correctes.
A continuació, trobareu la funció amb python, així com el programa per poder fer la funció.
def encrypt(plain_text, key):
    key = key.encode('utf-8')
    cipher = AES.new(key, AES.MODE_ECB)
    return base64.b64encode(cipher.encrypt(plain_text))
def decrypt(encrypted_text, key):
    key = key.encode('utf-8')
    cipher = AES.new(key, AES.MODE_ECB)
    return base64.b64decode(cipher.decrypt(encrypted_text))
def hash(plain_text, key):
    key = key.encode('utf-8')
    cipher = AES.new(key, AES.MODE_ECB)
    return base64.b64encode(cipher.encrypt(plain_text))
